import NavBar from "../components/NavBar";
import PlanetList from "../context/PlanetList.js";
import { useEffect, useState } from "react";
//BOOTSTRAP
import { Container, Row, Col, Button } from "react-bootstrap";
const Planets = () => {
  const pList = [{ Name: null, Population: null, Img: null, Ships: [] }];
  const [allPlanets, setAllPlanets] = useState(pList);
  useEffect(() => {
    if (allPlanets.length === 1) {
      setAllPlanets((allPlanets) => {
        return PlanetList;
      });
    }
  }, [allPlanets]);
  console.log(allPlanets);
  return (
    <Container>
      <NavBar />
      <Row className="singlePlanet">
        <Col className="planetPic">
          <img placeholder="planet" />
        </Col>
        <Col className="shipInfo">
          <img placeholder="planet" />
          <p>1000</p>
        </Col>
      </Row>
    </Container>
  );
};
export default Planets;
